dir\n    it = it + 1\n  }\n  return(beta)\n}\n","normpath":"/home/hugoboum/Documents/Parallel Computing/Project/aux_fcts_2b.R"},{"filename":"./basics.R","content":"source('./aux_fcts_2b.R')\n\nbasic.cv = function(x,y,betaO,its,kf){\n  \n  #Here we could shuffle the data if necessary\n  \n  folds = cut(seq(nrow(x)),breaks = kf,labels = FALSE)\n  errs = numeric(kf)\n  \n  for (i in 1:kf) {\n    train.ind = which(folds != i,arr.ind = TRUE)\n    beta_s =  rhapson_newton(x = x[train.ind,],y = y[train.ind],betaO = betaO, its = its)\n    preds = exp(x[-train.ind,] %*% beta_s) / (1 + exp(x[-train.ind,] %*% beta_s))\n    preds = as.numeric(preds >= 0.5)\n    errs[i] = sum((preds - y[-train.ind])**2) / length(preds)\n  }\n  return(mean(errs))\n}\n\nbasic.modelcomparison <- function(x,models,y,betaO,its,kf) {\n  #x should be a matrix of independant variables\n  #models should be a list, of which each element denotes the subset of selected variables (column indices of x)\n  models.errs = numeric(length(models))\n  \n  for (i in 1:length(models)) {\n    models.errs[i] = basic.cv(x = x[,models[[i]]],y = y,betaO = betaO,its = its,kf = kf)\n  }\n  return(list('vars'=models[[which.min(models.errs)]],'cv.err'= models.errs[which.min(models.errs)]))\n}\n\nbasic.modelselection <- function(forward) {\n  # forward should be a boolean\n  \n}","normpath":"/home/hugoboum/Documents/Parallel Computing/Project/basics.R"}],"prof_output":"/home/hugoboum/Documents/Parallel Computing/Project/.Rproj.user/99588069/profiles-cache/file6a8625fa5eee.Rprof","highlight":{"output":["^output\\$"],"gc":["^<GC>$"],"stacktrace":["^\\.\\.stacktraceo(n|ff)\\.\\.$"]},"split":"h"}},"evals":[],"jsHooks":[]}</script>
